import React, { useState } from 'react';

function Sidebar({ setActivePage }) {
  return (
    <div className="sidebar">
      <ul>
        <li onClick={() => setActivePage('home')}>Главная</li>
        <li onClick={() => setActivePage('pet')}>Личный кабинет</li>
        <li onClick={() => setActivePage('about')}>О нас</li> {}
      </ul>
    </div>
  );
}

export default Sidebar;
